-- ----------------------------
-- Table structure for act_all_proc
-- ----------------------------
DROP TABLE IF EXISTS `act_all_proc`;
CREATE TABLE `act_all_proc` (
  `proc_id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '流程id',
  `proc_num` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '流程编号',
  `name` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '流程名称',
  `icon_url` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '流程图标',
  `url` varchar(512) COLLATE utf8_bin DEFAULT NULL COMMENT '流程url',
  `process_code` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '流程code',
  `type` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '流程所属类详见字典表',
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `show_flag` varchar(2) COLLATE utf8_bin DEFAULT '0' COMMENT '''是否显示 0显示 1不显示''',
  `status_cd` varchar(2) COLLATE utf8_bin DEFAULT '0' COMMENT '数据状态，详细参考c_status表，S 保存，0, 在用 1失效',
  `context` text COLLATE utf8_bin COMMENT '流程文件',
  `system_type` varchar(10) COLLATE utf8_bin DEFAULT NULL COMMENT '系统类型',
  PRIMARY KEY (`proc_id`),
  KEY `idx_proc_id` (`proc_id`) USING BTREE,
  KEY `idx_type` (`type`) USING BTREE,
  KEY `idx_proc_code` (`process_code`(191)) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='所有流程记录表';

