DROP TABLE IF EXISTS `t_dict`;
CREATE TABLE `t_dict` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `status_cd` varchar(64) NOT NULL COMMENT '表字段状态 取值',
  `name` varchar(50) NOT NULL COMMENT '名称',
