  `table_name` varchar(50) DEFAULT NULL COMMENT '表名称',
  `table_columns` varchar(50) DEFAULT NULL COMMENT '表字段说明',
  `state` varchar(2) DEFAULT '0' COMMENT '0-保存，1删除',
  PRIMARY KEY (`id`),
  KEY `idx_status_cd` (`status_cd`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=527 DEFAULT CHARSET=utf8mb4 COMMENT='字典表';

