-- ----------------------------
-- Procedure structure for proc_deal_data
-- ----------------------------
DROP PROCEDURE IF EXISTS `proc_deal_data`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `proc_deal_data`(IN new_invoice VARCHAR(20),IN old_invoice VARCHAR(20),IN cycle INT,IN endTime VARCHAR(32))
lable:BEGIN	
	DECLARE newID VARCHAR(30);
  DECLARE oldID VARCHAR(30);
  DECLARE oldTime VARCHAR(30);
IF new_invoice ='' OR new_invoice IS NULL
THEN
	SELECT '发票号有误';
	LEAVE lable;
ELSE
  SELECT detail_id INTO newID  FROM pay_fee_detail WHERE invoice_number=new_invoice;
# 更新账单明细的detail_id为历史账单的detail_id,创建时间2018-12-15 00:00:00
  UPDATE pay_fee_month_detail SET detail_id=oldID,create_time=oldTime WHERE detail_id='123654879999';
  SELECT 'if更新测试1';
END IF;


	SELECT detail_id INTO oldID FROM pay_fee_detail WHERE invoice_number=old_invoice;
  SELECT create_time INTO oldTime FROM pay_fee_detail WHERE invoice_number=old_invoice;



# 更改老账单主表的周期， 结束时间
  UPDATE pay_fee_detail SET cycles=cycle ,end_time=endTime WHERE invoice_number = old_invoice;
  SELECT '更新测试2';
# 删除处理数据新建的主表
  DELETE FROM pay_fee_detail WHERE invoice_number='123654879999';
  SELECT '删除测试';
END
;;
DELIMITER ;
